import React from 'react'

import PropTypes from 'prop-types'

import styles from './image1.module.css'

const Image1 = (props) => {
  return (
    <div className={` ${styles['container']} ${styles[props.rootClassName]} `}>
      <div className={styles['container1']}>
        <img src={props.logo} loading="eager" className={styles['image']} />
      </div>
    </div>
  )
}

Image1.defaultProps = {
  logo: 'https://cdn-icons.flaticon.com/png/512/5086/premium/5086470.png?token=exp=1644928983~hmac=5d87d3ee6e426b446b8f2a0ba7562833',
  rootClassName: '',
}

Image1.propTypes = {
  logo: PropTypes.string,
  rootClassName: PropTypes.string,
}

export default Image1
